import React from "react";

import ProductList from "../../Pages/ProductList/ProductList";
import ContactUs from "../ContactUs/ContactUs";

const Home = ({ filtredProducts }) => {
  return (
    <div>
      Home
      <ProductList filtredProducts={filtredProducts}  />
      
      <ContactUs/>
    </div>
  );
};

export default Home;
